RootTable.Filter:
select t_attribute.ea_guid as CLASSGUID, 'Attribute' as CLASSTYPE, t_attribute.Name, t_attribute.StyleEx, t_object.*
from t_attribute inner join t_object on t_attribute.Object_ID = t_object.Object_ID
where t_object.Package_ID in (#Branch#) and t_object.Object_Type = 'Enumeration' and Instr(t_attribute.StyleEx, 'IsLiteral=0') <> 0;
